import React from 'react';
import './GreenBox.css';

const GreenBox = () => {
  return (
    <div className="green-box">
      <div className="white-content">
        {/* Your content goes here */}
        <p>This is white content inside a light green box.</p>
      </div>
    </div>
  );
};

export default GreenBox;
